import Data from "../../../db/db.json"
import DataSetCard from './datasetCard'

function Home() {
    console.log(Data);
    return (
        <div className="home">
            { Data.dataSets.map((item) => (
                <DataSetCard dataSet={item} />
            )) }
            <p>This is everything that the home page has to offer. Please be gentle. Please show all my data.</p>
            <p>This is how I was born, how I lived, and how I will die.</p>
            <p>It was rainy Monday in 1998. A cool January wind blew in from the east, bringing tidings of my fabled existence on an Atlantic breeze. My mother lounged on tightly-woven fabric couch, flipping through television channels with the discomfort of a large, pregnant woman.</p>
        </div>
    );
}

export default Home;
